        }
        
        .header h1 {

        }
        
        .stats-display {
            display: flex; align-items: center; gap: 15px;
            background: rgba(255,255,255,0.1); padding: 8px 15px; border-radius: 8px;
            font-size: 12px; font-weight: 500;
        }
        
        .stat-item {
            display: flex; flex-direction: column; align-items: center;
            min-width: 70px;
        }
        
        .stat-label {
            font-size: 10px; opacity: 0.8; margin-bottom: 2px;
        }
        
        .stat-value {
            font-size: 14px; font-weight: 700;
            color: #3498db;
        }
        
        .view-toggle {
            display: flex; align-items: center; gap: 8px;
            background: rgba(255,255,255,0.1); padding: 8px; border-radius: 8px;
        }
        
        .toggle-btn {
            padding: 6px 12px; border: 1px solid rgba(255,255,255,0.3);
            border-radius: 6px; background: rgba(255,255,255,0.1);
            color: white; font-size: 11px; font-weight: 600;
            cursor: pointer; transition: all 0.3s ease;
        }
        
        .toggle-btn.active {
            background: rgba(255,255,255,0.3);
            border-color: rgba(255,255,255,0.6);
            box-shadow: 0 2px 8px rgba(0,0,0,0.2);
        }
        
        .header-controls {
            display: flex; align-items: center; justify-content: space-between;
            gap: 10px; flex-wrap: wrap; margin-bottom: 8px;
        }
        
        .control-group {
            display: flex; align-items: center; gap: 4px;
        }
        
        .control-group-title {
            font-size: 10px; font-weight: 600; 
            opacity: 0.9; margin-right: 4px;
        }
        
        .header-btn {
            padding: 4px 8px; border: 1px solid rgba(255,255,255,0.3);
            border-radius: 4px; background: rgba(255,255,255,0.1);
            color: white; font-size: 9px; font-weight: 500;
            cursor: pointer; transition: all 0.3s ease;
        }
        
        .header-btn:hover {
            background: rgba(255,255,255,0.2);
            border-color: rgba(255,255,255,0.5);
        }
        
        .header-btn.active {
            background: rgba(255,255,255,0.3);
            border-color: rgba(255,255,255,0.6);
        }
        
        .reports-controls {
            display: flex; align-items: center; gap: 10px;
            background: rgba(46, 204, 113, 0.2); padding: 6px 12px; border-radius: 6px;
            border: 1px solid rgba(46, 204, 113, 0.4);
        }
        
        .download-btn {
            padding: 6px 12px; background: rgba(46, 204, 113, 0.8);
            color: white; border: none; border-radius: 4px;
            font-size: 10px; font-weight: 600; cursor: pointer;
            transition: all 0.3s ease;
        }
        
        .download-btn:hover {
            background: rgba(46, 204, 113, 1);
            transform: translateY(-1px);
        }
        
        #map-container {
            position: absolute;
            top: 130px;
            left: 0;
            width: 100vw;
            height: calc(100vh - 130px);
            overflow: hidden;
        }
        
        #map { height: 100%; width: 100%; }
        
        .loading {
            position: fixed; top: 50%; left: 50%; transform: translate(-50%, -50%);
            color: #2c3e50; font-size: 18px; font-weight: 500; z-index: 1001;
        }
        
        .notification {
            position: fixed; bottom: 20px; right: 20px;
            background: linear-gradient(135deg, #27ae60 0%, #2ecc71 100%);
            color: white; padding: 12px 20px; border-radius: 8px;
            font-size: 14px; font-weight: 500; z-index: 999;

            transform: translateX(100%); opacity: 0;

        }
        
        .notification.show {
            transform: translateX(0); opacity: 1;
        }
        
        .filter-indicator {
            position: fixed; top: 140px; left: 20px;
            background: rgba(52, 152, 219, 0.9); color: white;

            font-size: 12px; font-weight: 600;

        // DYNAMIC FILTERING FUNCTIONS
        function filterDataByRegion(data, region) {
            if (region === 'global') return data;
            return data.filter(item => item.Region === region);
        }
        
        function filterDataByCountry(data, country) {
            if (country === 'global') return data;
            return data.filter(item => item.Country === country);
        }
        
        function updateStatsDisplay(filteredData) {
            const mafData = currentFilter.type === 'region' ? 
                filterDataByRegion(rawData.maf, currentFilter.value) : 
                currentFilter.type === 'country' ? 
                filterDataByCountry(rawData.maf, currentFilter.value) : 
                rawData.maf;
                
            const pilotData = currentFilter.type === 'region' ? 
                filterDataByRegion(rawData.pilot, currentFilter.value) : 
                currentFilter.type === 'country' ? 
                filterDataByCountry(rawData.pilot, currentFilter.value) : 
                rawData.pilot;
                
            const commonData = currentFilter.type === 'region' ? 
                filterDataByRegion(rawData.common, currentFilter.value) : 
                currentFilter.type === 'country' ? 
                filterDataByCountry(rawData.common, currentFilter.value) : 
                rawData.common;
            
            document.getElementById('maf-count').textContent = mafData.length.toLocaleString();
            document.getElementById('pilot-count').textContent = pilotData.length.toLocaleString();
            document.getElementById('common-count').textContent = commonData.length.toLocaleString();
            
            // Update filter indicator
            const indicator = document.getElementById('filter-indicator');
            if (currentFilter.type === 'global') {
                indicator.style.display = 'none';
            } else {
                indicator.style.display = 'block';
                indicator.textContent = `Filtering: ${currentFilter.value}`;
            }
        }
        
        function calculateMarkerSize(groupSize, maxSize, baseSize = 6, maxMarkerSize = 25) {
            if (groupSize <= 1) return baseSize;
            const normalized = Math.log(groupSize) / Math.log(maxSize);
            return baseSize + (maxMarkerSize - baseSize) * normalized;
        }
        
        function createClusteredMap() {
            const data = [];
            
            // Filter clustered data based on current filter
            let mafClusters = clusteredData.maf;
            let pilotClusters = clusteredData.pilot;
            let commonClusters = clusteredData.common;
            
            if (currentFilter.type === 'region' && currentFilter.value !== 'global') {
                mafClusters = mafClusters.filter(d => d.Region === currentFilter.value);
                pilotClusters = pilotClusters.filter(d => d.Region === currentFilter.value);
                commonClusters = commonClusters.filter(d => d.Region === currentFilter.value);
            } else if (currentFilter.type === 'country' && currentFilter.value !== 'global') {
                mafClusters = mafClusters.filter(d => d.Country === currentFilter.value);
                pilotClusters = pilotClusters.filter(d => d.Country === currentFilter.value);
                commonClusters = commonClusters.filter(d => d.Country === currentFilter.value);
            }
            
            // Add regional background
            for (const [region, countries] of Object.entries(regionalData.countries)) {
                let showRegion = true;
                if (currentFilter.type === 'region' && currentFilter.value !== 'global') {
                    showRegion = region === currentFilter.value;
                }
                
                if (showRegion) {
                    data.push({
                        type: 'choropleth',
                        locations: countries,
                        z: new Array(countries.length).fill(1),
                        locationmode: 'ISO-3',
                        colorscale: [[0, regionalData.colors[region]], [1, regionalData.colors[region]]],
                        showscale: false,
                        hoverinfo: 'skip',
                        marker: { line: { color: 'white', width: 0.5 } },
                        name: `Region: ${region}`, // Unique name for choropleth traces
                        showlegend: false
                    });
                }
            }
            
            // Calculate max size for scaling from filtered data
            const allSizes = [
                ...mafClusters.map(d => d.GROUP_SIZE),
                ...pilotClusters.map(d => d.GROUP_SIZE),
                ...commonClusters.map(d => d.GROUP_SIZE)
            ];
            const maxSize = allSizes.length > 0 ? Math.max(...allSizes) : 1;
            
            // Add clustered PILOT (Layer 1 - bottom of points)
            if (pilotClusters.length > 0) {
                const pilotSizes = pilotClusters.map(d => calculateMarkerSize(d.GROUP_SIZE, maxSize));
                data.push({
                    type: 'scattermapbox',
                    lat: pilotClusters.map(d => d.Latitude),
                    lon: pilotClusters.map(d => d.Longitude),
                    mode: 'markers',
                    marker: {
                        size: pilotSizes,
                        color: '#C0392B', // Red
                        opacity: 0.8,
                        sizemode: 'diameter'
                    },
                    text: pilotClusters.map(d => d.PostalCode_3),
                    customdata: pilotClusters.map(d => d.GROUP_SIZE),
                    name: `PILOT Clusters (${pilotClusters.length})`, // Updated name for unique identification
                    hovertemplate: '<b>PILOT: %{text}***</b><br>Group Size: %{customdata} locations<br>Lat: %{lat:.4f}<br>Lon: %{lon:.4f}<br><extra></extra>'
                });
            }

            // Add clustered COMMON (Layer 2 - middle of points)
            if (commonClusters.length > 0) {
                const commonSizes = commonClusters.map(d => calculateMarkerSize(d.GROUP_SIZE, maxSize));
                data.push({
                    type: 'scattermapbox',
                    lat: commonClusters.map(d => d.Latitude),
                    lon: commonClusters.map(d => d.Longitude),
                    mode: 'markers',
                    marker: {
                        size: commonSizes,
                        color: '#FFFFFF', // White
                        opacity: 0.8,
                        line: { color: '#607D8B', width: 1 }, // Grey border for white points
                        sizemode: 'diameter'
                    },
                    text: commonClusters.map(d => d.PostalCode_3),
                    customdata: commonClusters.map(d => d.GROUP_SIZE),
                    name: `COMMON Clusters (${commonClusters.length})`, // Updated name for unique identification
                    hovertemplate: '<b>COMMON: %{text}***</b><br>Group Size: %{customdata} locations<br>Lat: %{lat:.4f}<br>Lon: %{lon:.4f}<br><extra></extra>'
                });
            }
            
            // Add clustered MAF (Layer 3 - top of points)
            if (mafClusters.length > 0) {
                const mafSizes = mafClusters.map(d => calculateMarkerSize(d.GROUP_SIZE, maxSize));
                data.push({
                    type: 'scattermapbox',
                    lat: mafClusters.map(d => d.Latitude),
                    lon: mafClusters.map(d => d.Longitude),
                    mode: 'markers',
                    marker: {
                        size: mafSizes,
                        color: '#0A3D62', // Dark Blue
                        opacity: 0.7,
                        sizemode: 'diameter'
                    },
                    text: mafClusters.map(d => d.PostalCode_3),
                    customdata: mafClusters.map(d => d.GROUP_SIZE),
                    name: `MAF Clusters (${mafClusters.length})`, // Updated name for unique identification
                    hovertemplate: '<b>MAF: %{text}***</b><br>Group Size: %{customdata} locations<br>Lat: %{lat:.4f}<br>Lon: %{lon:.4f}<br><extra></extra>'
                });
            }
            
            return data;
        }
        
        function createIndividualMap() {
            const data = [];
            
            // Filter individual data based on current filter
            let mafData = rawData.maf;
            let pilotData = rawData.pilot;
            let commonData = rawData.common;
            
            if (currentFilter.type === 'region' && currentFilter.value !== 'global') {
                mafData = mafData.filter(d => d.Region === currentFilter.value);
                pilotData = pilotData.filter(d => d.Region === currentFilter.value);
                commonData = commonData.filter(d => d.Region === currentFilter.value);
            } else if (currentFilter.type === 'country' && currentFilter.value !== 'global') {
                mafData = mafData.filter(d => d.Country === currentFilter.value);
                pilotData = pilotData.filter(d => d.Country === currentFilter.value);
                commonData = commonData.filter(d => d.Country === currentFilter.value);
            }
            
            // Add regional background
            for (const [region, countries] of Object.entries(regionalData.countries)) {
                let showRegion = true;
                if (currentFilter.type === 'region' && currentFilter.value !== 'global') {
                    showRegion = region === currentFilter.value;
                }
                
                if (showRegion) {
                    data.push({
                        type: 'choropleth',
                        locations: countries,
                        z: new Array(countries.length).fill(1),
                        locationmode: 'ISO-3',
                        colorscale: [[0, regionalData.colors[region]], [1, regionalData.colors[region]]],
                        showscale: false,
                        hoverinfo: 'skip',
                        marker: { line: { color: 'white', width: 0.5 } },
                        name: `Region: ${region}`, // Unique name for choropleth traces
                        showlegend: false

                }

            // Add individual PILOT points (Layer 1 - bottom of points)
            if (pilotData.length > 0) {
                data.push({
                    type: 'scattergeo',

                    lon: pilotData.map(d => d.Longitude),
                    mode: 'markers',
                    marker: { size: 8, color: '#C0392B', opacity: 1 }, // Red
                    text: pilotData.map(d => d['Postal CODE']),
                    name: `PILOT Locations (${pilotData.length})`, // Updated name for unique identification
                    hovertemplate: '<b>PILOT</b><br>Postal Code: %{text}<br>Lat: %{lat:.4f}<br>Lon: %{lon:.4f}<br><extra></extra>',
                    showlegend: true
                });
            }

            // Add individual COMMON points (Layer 2 - middle of points)
            if (commonData.length > 0) {
                data.push({
                    type: 'scattergeo',
                    lat: commonData.map(d => d.Latitude),
                    lon: commonData.map(d => d.Longitude),
                    mode: 'markers',
                    marker: { size: 8, color: '#FFFFFF', opacity: 1, line: { color: '#607D8B', width: 1 } }, // White with grey border
                    text: commonData.map(d => d['Postal Code']),
                    name: `COMMON Locations (${commonData.length})`, // Updated name for unique identification
                    hovertemplate: '<b>COMMON</b><br>Postal Code: %{text}<br>Lat: %{lat:.4f}<br>Lon: %{lon:.4f}<br><extra></extra>',
                    showlegend: true

            // Add individual MAF points (Layer 3 - top of points)
            if (mafData.length > 0) {
                data.push({

                    mode: 'markers',
                    marker: { size: 8, color: '#0A3D62', opacity: 1 }, // Dark Blue
                    text: mafData.map(d => d['Postal Code']),
                    name: `MAF Locations (${mafData.length})`, // Updated name for unique identification
                    hovertemplate: '<b>MAF</b><br>Postal Code: %{text}<br>Lat: %{lat:.4f}<br>Lon: %{lon:.4f}<br><extra></extra>',
                    showlegend: true
                });
            }
            
            return data;
        }
        
        function getMapLayout() {
            const isMapbox = currentView === 'clustered';
            
            // Calculate center and zoom based on filter
            let center = { lat: 0, lon: 0 };
            let zoom = 1;
            let scale = 1;
            
            if (currentFilter.type === 'region') {
                switch(currentFilter.value) {
                    case 'North America':
                        center = { lat: 50, lon: -100 };
                        zoom = 2; scale = 1.8;
                        break;
                    case 'Europe':
                        center = { lat: 55, lon: 15 };
                        zoom = 3; scale = 2.5;
                        break;
                    case 'Asia Pacific':
                        center = { lat: 20, lon: 120 };
                        zoom = 2; scale = 1.7;
                        break;
                    case 'Latin America':
                        center = { lat: -10, lon: -60 };
                        zoom = 2; scale = 1.5;
                        break;
                    case 'India, Middle East and Africa':
                        center = { lat: 20, lon: 40 };
                        zoom = 2; scale = 1.6;
                        break;
                }
            } else if (currentFilter.type === 'country') {
                switch(currentFilter.value) {
                    case 'USA':
                        center = { lat: 39, lon: -98 };
                        zoom = 3; scale = 3;
                        break;
                    case 'Germany':
                        center = { lat: 51, lon: 10 };
                        zoom = 5; scale = 8;
                        break;
                    case 'United Kingdom':
                        center = { lat: 55, lon: -3 };
                        zoom = 5; scale = 8;
                        break;
                }
            }
            
            if (isMapbox) {
                return {
                    mapbox: {
                        style: currentMapStyle,
                        center: center,
                        zoom: zoom
                    },
                    autosize: true,
                    margin: { l: 0, r: 0, t: 0, b: 0 },
                    showlegend: currentLegendState,
                    legend: {
                        x: 0.98, y: 0.5, xanchor: 'right', yanchor: 'middle',
                        bgcolor: 'rgba(255, 255, 255, 0.9)',
                        bordercolor: 'rgba(0, 0, 0, 0.1)', borderwidth: 1,
                        font: { size: 10 }
                    }
                };
            } else {
                return {
                    geo: {
                        projection: { type: 'equirectangular', scale: scale },
                        showframe: false, showcoastlines: false,
                        showland: true, landcolor: 'white',
                        showocean: true, oceancolor: 'white',
                        showcountries: true, countrycolor: 'white', countrywidth: 0.3,
                        center: center
                    },
                    autosize: true,
                    margin: { l: 0, r: 0, t: 0, b: 0 },
                    showlegend: currentLegendState,
                    legend: {
                        x: 0.98, y: 0.5, xanchor: 'right', yanchor: 'middle',
                        bgcolor: 'rgba(255, 255, 255, 0.9)',
                        bordercolor: 'rgba(0, 0, 0, 0.1)', borderwidth: 1,
                        font: { size: 10 }
                    }
                };
            }
        }
        
        function initializeMap() {
            document.getElementById('loading').style.display = 'none';
            
            const data = currentView === 'clustered' ? createClusteredMap() : createIndividualMap();
            const layout = getMapLayout();
            
            updateStatsDisplay();
            
            const config = {
                displayModeBar: true,
                displaylogo: false,
                responsive: true,
                scrollZoom: true,
                doubleClick: false,
                modeBarButtonsToRemove: ['lasso2d', 'select2d'],
                toImageButtonOptions: {
                    format: 'png',
                    filename: `global_gateway_${currentView}_${currentFilter.value}_map`,
                    width: 1920, height: 1080, scale: 2
                }
            };
            
            Plotly.newPlot('map', data, layout, config).then(function(gd) {
                mapInstance = gd;
                
                window.addEventListener('resize', function() {
                    Plotly.Plots.resize('map');
                });
                
                showNotification(`${currentView === 'clustered' ? 'Clustered' : 'Individual'} map loaded for ${currentFilter.value}!`);
            });
        }
        
        function switchView(view) {
            if (view === currentView) return;
            
            currentView = view;
            
            // Update toggle buttons
            document.querySelectorAll('.toggle-btn').forEach(btn => {
                btn.classList.remove('active');
                if ((view === 'clustered' && btn.textContent.includes('Clustered')) ||
                    (view === 'individual' && btn.textContent.includes('Individual'))) {
                    btn.classList.add('active');
                }
            });
            
            initializeMap();
        }
        
        function filterByRegion(region) {
            currentFilter = {type: region === 'global' ? 'global' : 'region', value: region};
            
            // Update filter buttons
            document.querySelectorAll('.control-group .header-btn').forEach(btn => {
                if (btn.onclick && btn.onclick.toString().includes('filterByRegion')) {
                    btn.classList.remove('active');
                }
            });
            event.target.classList.add('active');
            
            initializeMap();
            showNotification(`Filtered to ${region === 'global' ? 'global view' : region}`);
        }
        
        function filterByCountry(country) {
            currentFilter = {type: 'country', value: country};
            
            // Update country filter buttons  
            document.querySelectorAll('.control-group .header-btn').forEach(btn => {
                if (btn.onclick && btn.onclick.toString().includes('filterByCountry')) {
                    btn.classList.remove('active');
                }
            });
            event.target.classList.add('active');
            
            initializeMap();
            showNotification(`Filtered to ${country}`);
        }
        
        function changeMapStyle(style) {
            if (!mapInstance) return;
            
            currentMapStyle = style;
            
            // Update style buttons
            document.querySelectorAll('.control-group .header-btn').forEach(btn => {
                if (btn.onclick && btn.onclick.toString().includes('changeMapStyle')) {
                    btn.classList.remove('active');
                }
            });
            event.target.classList.add('active');
            
            if (currentView === 'clustered') {
                Plotly.relayout(mapInstance, {'mapbox.style': style});
            }
        }
        
        function showLayers(type) {
            if (!mapInstance) return;
            
            // Update layer buttons
            document.querySelectorAll('.control-group .header-btn').forEach(btn => {
                if (btn.onclick && btn.onclick.toString().includes('showLayers')) {
                    btn.classList.remove('active');
                }
            });
            event.target.classList.add('active');
            
            const update = { visible: [] }; // Array to hold new visibility states for all traces
            mapInstance.data.forEach((trace, i) => {
                let isVisible = false;
                // Always show regional background traces
                if (trace.type === 'choropleth') {
                    isVisible = true;
                } 
                // Handle data layers based on type
                else if (trace.name.includes('MAF')) {
                    isVisible = (type === 'all' || type === 'maf');
                } else if (trace.name.includes('PILOT')) {
                    isVisible = (type === 'all' || type === 'pilot');
                } else if (trace.name.includes('COMMON')) {
                    isVisible = (type === 'all' || type === 'common');
                }
                update.visible.push(isVisible);
            });
            
            Plotly.restyle(mapInstance, update);
            showNotification(`Showing ${type} layer(s)`);
        }
        
        function downloadReport(type) {
            let content, filename;
            
            switch(type) {
                case 'comprehensive':
                    content = comprehensiveReport;
                    filename = `comprehensive_analysis_${currentFilter.value}_${new Date().toISOString().slice(0,10)}.txt`;
                    break;
                case 'csv':
                    content = summaryCSV;
                    filename = `geographic_summary_${new Date().toISOString().slice(0,10)}.csv`;
                    break;
                case 'detailed_commonality':
                    content = commonalityReport;
                    filename = `detailed_commonality_analysis_${new Date().toISOString().slice(0,10)}.txt`;
                    break;
                case 'summary':
                    content = generateLiveSummary();
                    filename = `live_summary_${currentFilter.value}_${new Date().toISOString().slice(0,10)}.txt`;
                    break;
            }
            
            const blob = new Blob([content], { type: 'text/plain' });
            const url = URL.createObjectURL(blob);
            const a = document.createElement('a');
            a.href = url;
            a.download = filename;
            a.click();
            URL.revokeObjectURL(url);
            
            showNotification(`Downloaded ${type} report!`);
        }
        
        function generateLiveSummary() {
            const mafData = currentFilter.type === 'region' ? 
                filterDataByRegion(rawData.maf, currentFilter.value) : 
                currentFilter.type === 'country' ? 
                filterDataByCountry(rawData.maf, currentFilter.value) : 
                rawData.maf;
                
            const pilotData = currentFilter.type === 'region' ? 
                filterDataByRegion(rawData.pilot, currentFilter.value) : 
                currentFilter.type === 'country' ? 
                filterDataByCountry(rawData.pilot, currentFilter.value) : 
                rawData.pilot;
                
            const commonData = currentFilter.type === 'region' ? 
                filterDataByRegion(rawData.common, currentFilter.value) : 
                currentFilter.type === 'country' ? 
                filterDataByCountry(rawData.common, currentFilter.value) : 
                rawData.common;
            
            return `LIVE SUMMARY REPORT - ${currentFilter.value.toUpperCase()}
Generated: ${new Date().toLocaleString()}
Filter: ${currentFilter.type === 'global' ? 'Global View' : `${currentFilter.type}: ${currentFilter.value}`}
View Mode: ${currentView === 'clustered' ? 'Clustered Postal Codes' : 'Individual Locations'}

CURRENT STATISTICS:
MAF Records: ${mafData.length.toLocaleString()}
PILOT Records: ${pilotData.length.toLocaleString()}
COMMON Records: ${commonData.length.toLocaleString()}
Total Records: ${(mafData.length + pilotData.length + commonData.length).toLocaleString()}

UNIQUE POSTAL CODES:
MAF: ${new Set(mafData.map(d => d['Postal Code'])).size.toLocaleString()}
PILOT: ${new Set(pilotData.map(d => d['Postal CODE'])).size.toLocaleString()}
COMMON: ${new Set(commonData.map(d => d['Postal Code'])).size.toLocaleString()}

MAP CONFIGURATION:
Map Style: ${currentMapStyle}
Legends: ${currentLegendState ? 'Shown' : 'Hidden'}
Center: ${JSON.stringify(getMapLayout().mapbox?.center || getMapLayout().geo?.center)}
`;
        }
        
        function showLiveStats() {
            alert(generateLiveSummary()); // Use generateLiveSummary() to get the updated summary
        }
        
        function showNotification(message, type = 'success') {
            const notification = document.getElementById('notification');
            notification.textContent = message;
            notification.className = `notification show`;
            
            if (type === 'error') {
                notification.style.background = 'linear-gradient(135deg, #e74c3c 0%, #c0392b 100%)';
            } else {
                notification.style.background = 'linear-gradient(135deg, #27ae60 0%, #2ecc71 100%)';
            }
            
            setTimeout(() => {
                notification.classList.remove('show');
                setTimeout(() => {
                    notification.style.background = 'linear-gradient(135deg, #27ae60 0%, #2ecc71 100%)';
                }, 400);
            }, 3000);
        }
        
        document.addEventListener('DOMContentLoaded', function() {
            setTimeout(initializeMap, 100);
        });
